import React, {Component} from 'react'


class Form extends Component {
constructor(){
    super()
    this.state = {
        firstname:"",
        lastname:""
    }
}

sendData = (e) => {
    this.setState({
        firstname:e.target.value
    })
     console.log(e.target.value)
     e.preventDefault()
}

    render(){
    return (
        <form>
            <input type="text" name="firstname" onChange={this.sendData} value={this.state.firstname}/>
            <input type="text" name="lastname" onChange={this.sendData} value={this.state.lastname}/>
            <input type="submit" value="submit" onClick={this.sendData}/>
            {this.state.firstname}
        </form>
    )
}
}

export default Form
